import React from 'react';
import './App.css';
import Navbar from './components/Navbar';
import { BrowserRouter as Routes, Switch, Route } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Routes>
        <Navbar />
        <Switch>
          <Route path='/'></Route>
        </Switch>
      </Routes>

      <h1>Hello Im </h1>
      <p>I'm testing the auto update</p>
      <p>Tis is my second test to do</p>


    </div>
  );
}

export default App;
